import React from "react";

function Second() {
  return (
    <React.Fragment>
      <div className="container-fluid"></div>
      <div
        className="container-fluid"
        style={{ backgroundColor: "rgba(0,0,0,0.03)" }}
      >
        <div className="row">
          <div className="col-sm m-5">
            <h2>Hello</h2>
          </div>
          <div className="col-sm m-5">
            <p>Hello</p>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}
export default Second;
